using System;
using System.Collections.Generic;
using System.Linq;
using System.IO;
using System.Security.AccessControl;
using System.Security.Principal;

namespace DaLeLe
{
    internal class Program
    {
        static List<string> findVulnerableDLLs(string path, string username, List<string> tempStrings, bool writeBool)
        {
            var encodedDll = "";
            var dlls = Directory.GetFiles(path).Where(f => f.EndsWith(".dll", StringComparison.OrdinalIgnoreCase)).ToList();

            //checks for direct write access on the dll files
            foreach (var dll in dlls){
                FileInfo fdi = new FileInfo(dll);
                FileSecurity facl = fdi.GetAccessControl(AccessControlSections.Access);
                AuthorizationRuleCollection frules = facl.GetAccessRules(true, true, typeof(NTAccount));

                foreach (AuthorizationRule rule in frules)
                {
                    //If we find one that matches the identity we are looking for
                    if (rule.IdentityReference.Value.Equals(username, StringComparison.CurrentCultureIgnoreCase))
                    {
                        var filesystemAccessRule = (FileSystemAccessRule)rule;

                        //Cast to a FileSystemAccessRule to check for access rights
                        if ((filesystemAccessRule.FileSystemRights & FileSystemRights.WriteData) > 0 && filesystemAccessRule.AccessControlType != AccessControlType.Deny)
                        {
                            Console.WriteLine(string.Format("[+] {0} has write access to {1}", username, path));
                        }
                    }
                }
            }

            //checks for write access on the directory itself, if successfull then list all of the dlls (tempStrings) that can be exploited
            DirectoryInfo di = new DirectoryInfo(path);
            DirectorySecurity acl = di.GetAccessControl(AccessControlSections.Access);
            AuthorizationRuleCollection rules = acl.GetAccessRules(true, true, typeof(NTAccount));

            foreach (AuthorizationRule rule in rules)
            {
                //If we find one that matches the identity we are looking for
                if (rule.IdentityReference.Value.Equals(username, StringComparison.CurrentCultureIgnoreCase))
                {
                    var filesystemAccessRule = (FileSystemAccessRule)rule;

                    //Cast to a FileSystemAccessRule to check for access rights
                    if ((filesystemAccessRule.FileSystemRights & FileSystemRights.WriteData) > 0 && filesystemAccessRule.AccessControlType != AccessControlType.Deny)
                    {
                        Console.WriteLine(string.Format("[+] {0} has write access to {1}", username, path));
                        foreach(string dllPath in tempStrings)
                        {
                            Console.WriteLine(string.Format("[+] {0} can hijack {1} by writing to {2}", username, dllPath, path));

                            if (writeBool){
                                try{
                                    Console.WriteLine(string.Format("[+] Writing exploitation DLL on \"{0}\" as \"{1}\"", path, dllPath.Split('\\')[dllPath.Split('\\').Count() - 1]));
                                    File.WriteAllBytes(Path.Combine(path, dllPath.Split('\\')[dllPath.Split('\\').Count() - 1]), Convert.FromBase64String(encodedDll));
                                }catch (Exception ex){
                                    Console.WriteLine("[-] Something went wrong while writing DLL to vulnerable dir: " + ex.ToString());
                                    Environment.Exit(1);
                                }
                            }

                        }
                    }
                }
            }

            return dlls;
        }

        static void Main(string[] args)
        {

            string NtAccountName = System.Security.Principal.WindowsIdentity.GetCurrent().Name;

            string[] pathFolders = Environment.GetEnvironmentVariable("PATH").Split(';');

            var tempStrings = new List<string>();

            bool writeBool = false;
            bool fullBool = false;

            foreach (var arg in args){
                if(arg == "-h" || arg == "--help"){
                    Console.WriteLine("-h | --help  Displays this help message.\n-w | --write  Writes a dummy DLL on every writable directory contained on %PATH%.\n-f | --full  Also checks Program Files directories for DLLs, then return them as possible targets for hijacking on writable directories contained on %PATH%.");
                    Environment.Exit(0);
                }else{
                    if (arg == "-w" || arg == "--write"){
                        writeBool = true;
                    }
                    else{
                        if (arg == "-f" || arg == "--full"){

                            Console.WriteLine("[+] --full received, DLLs from program files directories shall be returned as possible targets for hijacking. I hope you know what you're doing.");

                            foreach (string dir in Directory.EnumerateDirectories(Environment.GetEnvironmentVariable("ProgramW6432"), "*"))
                            {
                                try
                                {
                                    var xxx = Directory.EnumerateFiles(dir, "*.dll", SearchOption.AllDirectories).ToList();
                                    tempStrings = Enumerable.Concat(tempStrings, xxx).ToList();
                                }
                                catch (Exception) { }
                            }

                            foreach (string dir in Directory.EnumerateDirectories(Environment.GetEnvironmentVariable("ProgramFiles(x86)"), "*"))
                            {
                                try
                                {
                                    var xxx = Directory.EnumerateFiles(dir, "*.dll", SearchOption.AllDirectories).ToList();
                                    tempStrings = Enumerable.Concat(tempStrings, xxx).ToList();
                                }
                                catch (Exception) { }
                            }

                            fullBool = true;
                        }
                    }
                }
            }

            if (writeBool && fullBool) {
                Console.WriteLine("[!] You are about to write " + tempStrings.Count() + " DLLs to every writable directory contained on %PATH% variable, are you sure about that?");
                Console.ReadLine();
            }

            //search for dlls on appdata
            foreach (string dir in Directory.EnumerateDirectories(Environment.GetEnvironmentVariable("APPDATA"), "*"))
            {
                try
                {
                    var xxx = Directory.EnumerateFiles(dir, "*.dll", SearchOption.AllDirectories).ToList();
                    tempStrings = Enumerable.Concat(tempStrings, xxx).ToList();
                }
                catch (Exception) { }
            }

            foreach (string dir in Directory.EnumerateDirectories(Environment.GetEnvironmentVariable("LOCALAPPDATA"), "*"))
            {
                try
                {
                    var xxx = Directory.EnumerateFiles(dir, "*.dll", SearchOption.AllDirectories).ToList();
                    tempStrings = Enumerable.Concat(tempStrings, xxx).ToList();
                }
                catch (Exception) { }
            }

            //going through each folder to find all DLLs, check our write permissions on them and add them on to a list for the next phase
            for (int i = pathFolders.Length - 1; i >= 0; i--){
                Console.WriteLine("[#] Checking \"" + pathFolders[i] + "\" for writeable DLLs.");
                if (Directory.Exists(pathFolders[i])){
                    tempStrings = Enumerable.Concat(tempStrings, findVulnerableDLLs(pathFolders[i], NtAccountName, tempStrings, writeBool)).ToList();
                }
            }
        }
    }
}